// App.jsx
import List from "./components/List";

function App() {
  const vegetables = [
    { id: 1, name: "potato", calories: 110 },
    { id: 2, name: "corn", calories: 10 },
    { id: 3, name: "broccoli", calories: 210 }
  ];

  return (
    <>
      <List item={vegetables} category="vegetable" />
    </>
  );
}

export default App;
